import { FormLabel, makeStyles, TextField } from '@material-ui/core';
import React from 'react';

type MyInputfieldProps = {
  labelText: string,
  labelClass: string,
  name: string,
  value: string,
//   onChange: () => void,
//   error: string,
//   size: string,
  required: boolean,
//   errors: ErrorType;
  handleChange: (event: React.ChangeEvent<HTMLInputElement>) => void;
};

const useStyles = makeStyles({
//   form: {
//     backgroundColor: "skyblue",
//     margin: "0px 10px",
//   },
//   formGroup: {
//     display: "grid",
//     gridTemplateColumns: "repeat(8, 1fr)",
//     padding: "5px",
//   },
  FormLeftLevel: {
    gridColumn: "1/2",
    color: "black",
    "&.MuiFormLabel-root": {
      fontSize: "12px",
    },
    width: "100px",
  },
  FormRightLevel: {
    gridColumn: "6/7",
    color: "black",
    "&.MuiFormLabel-root": {
      fontSize: "12px",
    },
  },
  inputField: {
    border: "1px solid black",
    backgroundColor: "white",
    borderRadius: "50px",
    gridColumn: "2/4",
  },
  inputFieldLarge: {
    border: "1px solid black",
    backgroundColor: "white",
    borderRadius: "50px",
    gridColumn: "2/6",
  },
  inputFieldRight: {
    border: "1px solid black",
    backgroundColor: "white",
    borderRadius: "50px",
    gridColumn: "7/9",
  },
  errorMessage: {
    Color: "red",
    padding: "10px",
  },
});

const MyInputfield : React.FC<MyInputfieldProps> = (props) => {
    const { labelText, name, value, required, handleChange } =
      props;
  const classes = useStyles();

    return (
      <>
        <FormLabel className={classes.FormLeftLevel}>{labelText}</FormLabel>
        <TextField
          name={name}
          value={value}
          required={required}
          InputProps={{ disableUnderline: true }}
          className={classes.inputField}
          onChange={handleChange}
        //   helperText={props.errors.firstName}
        //   error={Boolean(`${error}.${name}`)}
        />
      </>
    );
};

export default MyInputfield;
